import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './components/Home/Home/Home';
import LocationDetails from './components/Home/LocationDetails/LocationDetails';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Home/>
      <Routes>
        <Route path='/details/:id'>
          <LocationDetails/>
        </Route>
      </Routes>
    </div>
    </BrowserRouter>

  );
}

export default App;
